from Crypto import Random
from Crypto.Cipher import AES

class AESDecryptor:

    def __init__(self, key, iv, digest='sha256'):
        self.key = key
        self.iv = iv
        self.digest = digest

    def decrypt(self, encrypted_text):
        crypto = AES.new(self.key, AES.MODE_CBC, self.iv)
        data = base64.b64decode(encrypted_text)
        b64_decrypted_data = crypto.decrypt(data)
        return base64.b64decode(b64_decrypted_data).decode('utf8')

    def encrypt(self, plant_text):
        crypto = AES.new(self.key, AES.MODE_CBC, self.iv)
        base64_encode = base64.b64encode(plant_text).decode('utf8')
        b64_encrypted_data = crypto.encrypt(self.pad(base64_encode, 16))
        return base64.b64encode(b64_encrypted_data).decode('utf8')

    def pad(self, s, bs):
        s = s.encode()
        res = s + (bs - len(s) % bs) * chr(bs - len(s) % bs).encode()
        return res

